import './App.css';
import OpeningFileIcon from './Components/Icons/OpeningFileIcon.js';
import ResumeFileIcon from './Components/Icons/ResumeFileIcon.js';

function App() {
  return (
    <div class="h-screen w-screen bg-black flex-col">
      <OpeningFileIcon />
      <ResumeFileIcon />
    </div>
  );
}

export default App;
